import React from 'react';
import ReactDOM from 'reactDOM';
import './App.css';
import SignUp from './components/SignUp';


const App = () => {
  return (
    <div className="home contaner">
      <h2>Home</h2>
      <SignUp />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
